<!DOCTYPE html>
<html>
<head>
	<title></title>
</head>
<body>
	<script type="text/javascript">
		
		var middle = [1,2,3,4,5,6]
		var high = [7,8,9,0]
		var list = []
		var set = new Set()
		for (var i = 0; i < 2; i++) {
			for (var i = 0; i < high.length; i++) {
				for (var z = 0; z < middle.length; z++) {
					list.push([high[i],middle[z]])
					if(!set.has([high[i],middle[z]])){
						set.add([high[i],middle[z]])
					}
				}
			}	
		}
		console.log(set)



	</script>
</body>
</html>
